import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";

class AboutGrid extends Component {
  render() {
    return (
      <Grid>
        <Cell col={4}>left</Cell>
        <Cell col={8}>left</Cell>
      </Grid>
    );
  }
}

export default AboutGrid;
